style.css:
@-moz-document domain("youtube.com") {
/* Import Gothic Font */
    /* Corrected import method */
    /* General Theme */
    body, #page-manager, ytd-app {
        background-color: #0A0A14 !important; /* Darker, more mysterious background */
        color: #8B0000 !important; /* Dark red text color */
        font-family: 'UnifrakturMaguntia', serif !important; /* Gothic font */
    }

    /* Gothic Background Overlay */
    body::before {
        content: '';
        position: fixed;
        top: 0;
        left: 0;
        width: 100%;
        height: 100%;
        background: url('https://i.imgur.com/8UuTfHV.jpg') no-repeat center center fixed; /* Gothic background image */
        background-size: cover;
        opacity: 0.1; /* Slightly darker for mystery */
        z-index: -1;
    }

    /* Header Bar */
    #masthead-container {
        background-color: #290066 !important; /* Darker gothic purple header */
        border-bottom: 1px solid #4A0CA3 !important; /* Gothic border */
    }

    #logo-icon-container {
        filter: invert(100%) !important; /* Invert logo colors for contrast */
    }

    /* Sidebar */
    ytd-guide-section-renderer, ytd-guide-entry-renderer {
        background-color: #290066 !important; /* Darker sidebar background */
        color: #8B0000 !important; /* Dark red text color */
        border-bottom: 1px solid #4A0CA3 !important; /* Gothic border */
    }

    ytd-guide-renderer {
        border-right: 1px solid #4A0CA3 !important; /* Gothic border */
    }

    /* Recommended Video Boxes */
    ytd-compact-video-renderer, ytd-video-renderer {
        background-color: #1A1A2E !important; /* Dark purple background for recommended videos */
        border: 1px solid #4A0CA3 !important; /* Cool gothic border */
        border-radius: 10px !important; /* Rounded corners */
        margin: 5px 0 !important; /* Add spacing between video boxes */
        box-shadow: 0px 0px 10px #4A0CA3 !important; /* Soft gothic shadow */
    }

    /* Video Thumbnails */
    ytd-thumbnail, .ytd-thumbnail {
        border-radius: 10px !important; /* Rounded corners */
        box-shadow: 0px 0px 15px #4A0CA3 !important; /* Soft gothic shadow */
    }

    /* Video Titles */
    h3, h4, .title, .yt-simple-endpoint {
        color: #8B0000 !important; /* Dark red text for video titles */
        font-family: 'UnifrakturMaguntia', serif !important; /* Gothic font */
    }

    /* Three Dots Menu (visible) */
    ytd-menu-renderer yt-icon-button, ytd-menu-renderer yt-icon {
        color: #8B0000 !important; /* Dark red color */
        opacity: 1 !important; /* Make the three dots fully visible */
    }

    /* Buttons and Icons */
    .yt-icon-button, #buttons ytd-button-renderer, tp-yt-paper-button, yt-icon, .ytp-icon {
        background-color: #290066 !important; /* Darker purple buttons */
        color: #8B0000 !important; /* Dark red text/icons */
        border: 1px solid #4A0CA3 !important; /* Gothic border */
        border-radius: 5px !important; /* Rounded corners */
        box-shadow: 0px 0px 5px #4A0CA3 !important; /* Soft shadow for icons */
    }

    .yt-icon-button:hover, #buttons ytd-button-renderer:hover, tp-yt-paper-button:hover, yt-icon:hover, .ytp-icon:hover {
        background-color: #3A0CA3 !important; /* Lighter purple on hover */
        box-shadow: 0px 0px 10px #5A0CA3 !important; /* Intense glow on hover */
    }

    /* Links */
    a.yt-simple-endpoint {
        color: #8B0000 !important; /* Dark red links */
        font-family: 'UnifrakturMaguntia', serif !important; /* Gothic font */
    }

    a.yt-simple-endpoint:hover {
        color: #5A0CA3 !important; /* Darker purple on hover */
    }

    /* YouTube Channel Names */
    #channel-name, .ytd-channel-name {
        color: #8B0000 !important; /* Dark red channel names */
        font-family: 'UnifrakturMaguntia', serif !important; /* Gothic font */
    }

    /* Comments Section */
    ytd-comment-renderer, #comment, #simple-box {
        background-color: #220033 !important; /* Darker purple for comments */
        color: #8B0000 !important; /* Dark red text for comments */
        border-radius: 10px !important; /* Rounded corners */
        border: 1px solid #4A0CA3 !important; /* Gothic border */
    }

    ytd-comment-renderer #author-text, ytd-comment-renderer #content-text {
        color: #8B0000 !important; /* Dark red for comment text */
        font-family: 'UnifrakturMaguntia', serif !important; /* Gothic font */
    }

    /* Footer */
    #footer-container {
        background-color: #290066 !important; /* Darker gothic purple footer */
        color: #8B0000 !important; /* Dark red text */
        border-top: 1px solid #4A0CA3 !important; /* Gothic border */
    }

    /* Scrollbar */
    ::-webkit-scrollbar {
        width: 10px;
    }

    ::-webkit-scrollbar-thumb {
        background-color: #4A0CA3;
        border-radius: 10px;
    }

    ::-webkit-scrollbar-thumb:hover {
        background-color: #5A0CA3;
    }

    ::-webkit-scrollbar-track {
        background-color: #0A0A14;
    }
}
